import React from "react";

function CardTitleText() {
  let name = ""
  if (firstname && lastname) {
    name = firstname[0].toUpperCase() + firstname.slice(1).lowerCase();
    name += firstname[0].toUpperCase() + firstname.slice(1).lowerCase();
  }
  return <h2>Name Here</h2>;
}

export default CardTitleText;
